{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/giahogduc/cyclist-case-study?scriptVersionId=148162268\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"1e4cef64","metadata":{"papermill":{"duration":0.008876,"end_time":"2023-10-27T02:31:29.37875","exception":false,"start_time":"2023-10-27T02:31:29.369874","status":"completed"},"tags":[]},"source":["# Google Data Analyst Case study: How does bike-share navigate a speedy success\n","\n","# BACKGROUND\n","    In 2016, Cyclistic launched a successful bike-share offering. Since then, the program has grown to a fleet of 5,824 bicycles that are geotracked and locked into a network of 692 stations across Chicago. The bikes can be unlocked from one station and returned to any other station in the system anytime.\n","    Until now, Cyclistic’s marketing strategy relied on building general awareness and appealing to broad consumer segments. One approach that helped make these things possible was the flexibility of its pricing plans: single-ride passes, full-day passes, and annual memberships. Customers who purchase single-ride or full-day passes are referred to as casual riders. Customers who purchase annual memberships are Cyclistic members.\n","    This report will examine the business question: \"How do annual members and casual riders use Cyclistic bikes differently?\", and it will be done in the process of: Ask, Process, Analyze, Share and Act.\n","\n","# ASK - A clear statement of the business task\n","    This report will demonstrates the differences in bike usage of the two types of customers: casual riders and Cyclistic members, which will help Cyclistic understand different customer behavior and make necessary modifications to their service in order to improve customers' experience.\n","\n","# PREPARE - Information about the data used for this analytic.\n","    The datasets used for this report was taken from https://divvy-tripdata.s3.amazonaws.com/index.html, which was licenced by Motivate International Inc. The datasets contain 12 months of bike-share information, from July 2022 to June 2023.\n","\n","# PROCESS\n","## Tool\n","    For this Analysis, Excel was used for initial data inspection, R was used to clean, analyze as well as visualize the data.\n","## The cleaning process"]},{"cell_type":"code","execution_count":1,"id":"2e335ff5","metadata":{"execution":{"iopub.execute_input":"2023-10-27T02:31:29.397549Z","iopub.status.busy":"2023-10-27T02:31:29.395196Z","iopub.status.idle":"2023-10-27T02:31:30.693226Z","shell.execute_reply":"2023-10-27T02:31:30.691321Z"},"papermill":{"duration":1.310541,"end_time":"2023-10-27T02:31:30.696625","exception":false,"start_time":"2023-10-27T02:31:29.386084","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["── \u001b[1mAttaching core tidyverse packages\u001b[22m ──────────────────────── tidyverse 2.0.0 ──\n","\u001b[32m✔\u001b[39m \u001b[34mdplyr    \u001b[39m 1.1.2     \u001b[32m✔\u001b[39m \u001b[34mreadr    \u001b[39m 2.1.4\n","\u001b[32m✔\u001b[39m \u001b[34mforcats  \u001b[39m 1.0.0     \u001b[32m✔\u001b[39m \u001b[34mstringr  \u001b[39m 1.5.0\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2  \u001b[39m 3.4.2     \u001b[32m✔\u001b[39m \u001b[34mtibble   \u001b[39m 3.2.1\n","\u001b[32m✔\u001b[39m \u001b[34mlubridate\u001b[39m 1.9.2     \u001b[32m✔\u001b[39m \u001b[34mtidyr    \u001b[39m 1.3.0\n","\u001b[32m✔\u001b[39m \u001b[34mpurrr    \u001b[39m 1.0.1     \n","── \u001b[1mConflicts\u001b[22m ────────────────────────────────────────── tidyverse_conflicts() ──\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mfilter()\u001b[39m masks \u001b[34mstats\u001b[39m::filter()\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mlag()\u001b[39m    masks \u001b[34mstats\u001b[39m::lag()\n","\u001b[36mℹ\u001b[39m Us