ual customers use their bikes as some sort of summer exercise. Members ride duration also had a significant increase in June, however, afterward saw a steady decrease instead of a sudden peak and drop.\n","    Electric bikes seem to be the most popular among both types of customers. Interestingly, only casual users use docked bikes.\n","    \n","# ACT\n","Recommendations:\n","- Have a survey among members to find out the hotspot of member occupation, then provide more stations for ease of access for daily bike commuters.\n","- Have a large-scale bike maintenance in May - before the peak of usage which is June to ensure customers’ satisfaction.\n","- Improve electric bike battery, overall performance with further R&D since it is the most popular type of bike."]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":257.628964,"end_time":"2023-10-27T02:35:43.152122","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2023-10-27T02:31:25.523158","version":"2.4.0"}},"nbformat":4,"nbformat_minor":5}